import { CursoCreateComponent } from './curso-create/component/curso-create.component';
import { CommonModule } from '@angular/common';
import { NgModule } from '@angular/core';
import { MarcaCreateComponent } from './marca-create/component/marca-create.component';
@NgModule({
  imports: [CommonModule, FormsModule],
  declarations: [MarcaCreateComponent],
  exports: [CursoCreateComponent],
})
export class MarcaModule {}
